INSERT INTO `error_codes` (`code_id`, `short_describtion`, `describtion`) VALUES
(200, 'OK', 'Стандартна відповідь про успішне виконання HTTP запиту. Фактична відповідь буде залежати від методу запиту. Для запитів GET, відповідь буде містити зміст об’єкту чи сторінки у відповідності до запитаного ресурсу. Для запитів POST відповідь буде містити опис об’єкту чи результат операції.'),
(301, 'Moved Permanently – Ресурс переміщено назавжди', 'Цей і всі наступні запити повинні бути спрямовані по вказаному новому URI.'),
(302, 'Found – Ресурс тимчасово переміщено', 'Зазвичай використовується для виконання перенаправлення на іншу сторінку і додатково містить в собі URL-посилання на HTTP локацію в полі HTTP заголовка.'),
(304, 'Not Modified - - Ресурс не змінювався', 'Вказує на те, що ресурс не був змінений з моменту останнього запиту. Як правило, клієнт HTTP надає заголовок, з вказаним параметром заголовку «If-Modified-Since» або «If-Match», аби передати час останього запиту, з яким можна порівнювати дату зміни ресурсу. Використання таких умов знижує навантаження на мережу, оскільки ресурс не потрібно повтороно передавати клієнту. Таким чином підвищується пропускна здатність сервера і клієнта.'),
(404, 'Not Found ', 'Ресурс не знайдено, але він може бути доступний в майбутньому.');
